import React from "react";
import "./home.css";

function Home() {
    return (
        <div className="Home">
            <div className="HomeContainer">
                <div className="HomeTitle">Order delivery near you</div>

                <div className="AddressForm">
                    <input type="text" className="AddressInput" placeholder="Enter delivery address" />
                    <button className="DeliverNow">Deliver now</button>
                    <button className="SearchButton">Search here</button>
                </div>

                <div className="SignIn">Or <a href="#">Sign In</a></div>
            </div>
        </div>
    );
}

export default Home;
